// contracts/ScabShop.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/IAccessControl.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract ScabShop is ERC721, Ownable, AccessControl {

  using Counters for Counters.Counter;
  Counters.Counter private ids;

  mapping(uint256 => string) public metadataHash;
  mapping(uint256 => string) public contentHash;

  mapping(uint256 => bool) private stamps;
  mapping(uint256 => address) private artists;
  mapping(uint256 => uint256) private royalties;
  mapping(uint256 => uint256) private prints;

  bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

  event Stamp(uint256 id);

  constructor() ERC721('ScabShop', 'SCBSHP') {
    _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
    _setupRole(MINTER_ROLE, msg.sender);
  }

  function supportsInterface(bytes4 _interfaceId) public view virtual override(ERC721, AccessControl) returns (bool) {
    return _interfaceId == type(IERC721).interfaceId ||
           _interfaceId == type(IAccessControl).interfaceId ||
           super.supportsInterface(_interfaceId);
  }

  function tokenURI(uint256 _id) public view override(ERC721) returns (string memory) {
    return string(abi.encodePacked('https://ipfs.infura.io/ipfs/', metadataHash[_id]));
  }

  function metadataURI(uint256 _id) public view returns (string memory) {
    return string(abi.encodePacked('https://ipfs.infura.io/ipfs/', metadataHash[_id]));
  }

  function contentURI(uint256 _id) public view returns (string memory) {
    return string(abi.encodePacked('https://ipfs.infura.io/ipfs/', contentHash[_id]));
  }

  function originalOf(uint256 _id) public view returns (uint256) {
    require(prints[_id] > 0, 'This token is not a print');
    return prints[_id];
  }

  function artistOf(uint256 _id) public view returns (address) {
    return artists[_id];
  }

  function mint(string memory _metadata, string memory _content, uint256 _royalty) public onlyRole(MINTER_ROLE) returns (uint256) {
    require(_royalty <= 10000, 'ERC2981Royalties: Too high');
    ids.increment();
    uint256 _id = ids.current();
    _mint(msg.sender, _id);
    metadataHash[_id] = _metadata;
    contentHash[_id] = _content;
    artists[_id] = msg.sender;
    stamps[_id] = false;
    royalties[_id] = _royalty;
    return _id;
  }

  function stamp(uint256 _id, string memory _metadata, string memory _content) public onlyRole(MINTER_ROLE) {
    require(address(msg.sender) == artists[_id], 'Only the artist can stamp their token');
    require(prints[_id] == 0, 'Only original nfts can be stamped');
    require(stamps[_id] == false, 'This token has already been stamped');
    metadataHash[_id] = _metadata;
    contentHash[_id] = _content;
    stamps[_id] = true;
    emit Stamp(_id);
  }

  function isStamped(uint256 _id) public view returns (bool) {
    return stamps[_id];
  }

  function mintPrints(uint256 _id, string memory _metadata, string memory _content, uint256 _royalty, uint256 _quantity) public onlyRole(MINTER_ROLE) returns (uint256[] memory) {
    require(msg.sender == artists[_id], 'Only the artist can mint prints of their token');
    require(stamps[_id] == true, 'This token has not yet been stamped');
    require(_royalty <= 10000, 'ERC2981Royalties: Too high');
    uint256[] memory _printIds = new uint[](125);
    for(uint i = 0; i < _quantity; i++) {
      ids.increment();
      uint256 _printId = ids.current();
      _mint(msg.sender, _printId);
      metadataHash[_id] = _metadata;
      contentHash[_id] = _content;
      artists[_printId] = artists[_id];
      stamps[_printId] = stamps[_id];
      royalties[_printId] = _royalty;
      prints[_printId] = _id;
      _printIds[i] = _printId;
    }
    return _printIds;
  }

  function royaltyInfo(uint256 _id, uint256 value) external view returns (address receiver, uint256 royaltyAmount) {
     receiver = artists[_id];
     royaltyAmount = (value * royalties[_id]) / 10000;
   }

}
